      Hint: SubText
      Value: "For long-term residual insect control, Enstar AQ IGR formulation provides greenhouse growers an effective insect growth regulator (IGR) that delivers the results you are looking for while being gentle on plants and beneficials. Once the invasive nursery and greenhouse insects come into contact with the active ingredient, S-Kinoprene, they lay sterile eggs, preventing future generations from emerging."
